INSERT INTO `w7f_map`.`gravity` (`gravid`, `name`, `desc`) VALUES (1, 'Low Gravity', 'All models maximum movement is increased by 2” regardless of any abilities the model may have. Low Gravity can only increase your movement  to a maximum of 12”. Models without a movement speed are unaffected. ');
INSERT INTO `w7f_map`.`gravity` (`gravid`, `name`, `desc`) VALUES (2, 'Normal Gravity', 'No effect');
INSERT INTO `w7f_map`.`gravity` (`gravid`, `name`, `desc`) VALUES (3, 'High Gravity', 'All models maximum movement is reduced by 2”,regardless of any abilities the model may have. High Gravity can only reduce your movement to a minimum of 5”  Models without a movement speed are unaffected. ');
INSERT INTO `w7f_map`.`gravity` (`gravid`, `name`, `desc`) VALUES (0, 'No Gravity', 'No gravity');
INSERT INTO `w7f_map`.`planettrait` (`planettraitid`, `name`, `desc`, `trait_1`, `trait_2`, `trait_3`, `trait_4`, `trait_5`, `trait_6`, `trait_7`, `kt_trait_1`, `kt_trait_2`) VALUES (1, 'Burning', NULL, 'Critical Weapon Failures: The heat here is intolerable, and overcharged weaponry becomes even more hazardous for the wielder. When a model would be removed or suffer mortal wounds as a result of rolling a 1 on an attack roll (Such as Supercharging a Plasma Cannon or Overcharging an Ion Rifle) it is triggered on an unmodified result of 1 or 2 instead.', 'Volcanic Eruption: Orbital bombardments and heavy ordnance have disturbed a volcano, and it threatens to erupt at any time. At the start of each battle round, roll a single d6, adding 1 to the result for each round that has passed. On a 6+ the volcano erupts. Every unit on the battlefield suffers D3 mortal wounds as fiery debris and burning ash cover the battlefield. Once the volcano has erupted, do not roll to see if it erupts again.', 'Fault Zone: Constant volcanic turmoil, and the churning of continental shelves make every step here treacherous. This battlezone uses fracture tokens to represent weak points in the earth. Before the battle, after the battlefield has been created, the players roll off. Starting with the winner, players alternate placing fracture tokens on the battlefield until each has placed three tokens. Each fracture token must be placed more than 9” away from any other fracture token. Each player assigns the number 1-3 to the fracture tokens that they placed. ', 'Fault Lines: At the start of each battle round, the players must determine which, if any, fault lines have opened up. The number of fault lines that open are based on the battle round number shown below.When a fault line opens, each player rolls one D3 to determine one of the fracture tokens that they placed at the start of the battle. The fault line that opens up then runs between these two points. Draw a straight line from the center of one fracture token to the center of the other. Each unit (excluding units that can FLY) that lies beneath this line falls foul of the fault line and becomes affected by it. If a TITANIC unit lies beneath this line, it only falls foul on a D6 roll of 4+. Each unit can only fall foul of one fault line per battle round. Each time a unit becomes affected by a fault line, roll on the below table to see what happens to it.Open fault lines remain open for the remainder of the battle. If when rolling to see if a new fault line opens, and open fault line already runs between the two fracture tokens rolled, then roll aain to see if the units on the line fall foul of the fault line as described above. Each time a model in a unit (Excluding TItANIC units or units that can FLY) makes an Advance or charge move across any open fault lines, roll one D6: on a 1 that model’s unit suffers 1 mortal wound.', NULL, NULL, NULL, 'Volcanic Smog: Thick ash and smoke clouds the battlefield. Attacks made against targets further than 12” from the attacking model suffer -1 to hit. ', 'Boiling Earth: Intolerable heat threatens to cook any alive who tarry too long. Whenever a model Readies, treat them as having moved into Dangerous Ground. ');
INSERT INTO `w7f_map`.`planettrait` (`planettraitid`, `name`, `desc`, `trait_1`, `trait_2`, `trait_3`, `trait_4`, `trait_5`, `trait_6`, `trait_7`, `kt_trait_1`, `kt_trait_2`) VALUES (2, 'Hot', NULL, 'Sandstorm: Whipping sand stings the eye and clogs optical sensors obscuring your foe from view. When shooting an enemy unit, subtract 1 from the hit roll if the unit is further than 12” away.', 'Heat Exhaustion: The punishing heat pushes warriors and motive engines to their limits. Subtract 1 from the Attacks characteristics of all models, to a minimum of 1.', 'Dry River Valley: Strategic dams control the few water sources on this world, and their defense or destruction can shape the battle. Before the battle, after determining who the Attacker and Defender will be, the Attacker rolls one D6 and consults the diagram below to determine the centre line of the valley.', 'Damage to the Dam: At the start of the battle, the dam has 0 damage points, as it has not yet sustained any damage. As the battle progresses and the dam is weakened, this number will increase. The more damage points the dam accrues, the more likely it is to burst and the more serious the flood will be. At the end of each battle round, the dam accrues D3 damage points. ', 'Dam Bursting: From the second battle round onwards, at the start of each battle round, if the dam has not already burst, the Attacker rolls one D6 and consults the table below to see if the dam bursts. ', 'Mud Lake: After the dam has burst, the following rules take effect: Subtract 1” from the MOve characteristic of all models (excluding models that can fly). Models cannot receive the benefits of cover from Obstacle terrain features: In the Movement phase, each time a VEHICLE or MONSTER unit is selected to move (excluding units that can FLY), roll one D6, subtracting 1 if that unit has the TITANIC keyword: on a 1, that unit is stuck in the mud and can only be selected to Remain Stationary. When playing a game using this Theater of War, both players have access to the following action: Sabotage: At the end of each battle round, starting with the Attacker, each player can select one unit from their army that is in Strategic Reserves to damage the dam. For each unit that does so, if that unit has a Power Rating of 5 or less, the dam accrues D3 Damage points; otherwise, the dam accrues D6 damage points. ', NULL, 'Draining Heat:  The scorching sun saps the strength of even the greatest warriors. Subtract 1 from the Strength Characteristic of all models. ', NULL);
INSERT INTO `w7f_map`.`planettrait` (`planettraitid`, `name`, `desc`, `trait_1`, `trait_2`, `trait_3`, `trait_4`, `trait_5`, `trait_6`, `trait_7`, `kt_trait_1`, `kt_trait_2`) VALUES (3, 'Temperate', NULL, 'Inclimate weather: More of an annoyance to command and a suffering life condition for individual troops. Subtract 1 from all units Leadership characteristic.', 'Just like Home: This world looks just like your troops home planet, and their anger at it being defiled by your foes hardens their nerves. Add 1 to all units\' Leadership characteristic. ', NULL, NULL, NULL, NULL, NULL, 'Aggressive Flora: Predatory plants are attracted to sudden bursts of movement. Whenever a model Advances, roll a D6. On a 6, the model suffers a mortal wound.', 'Overgrown Jungle: Dense vegetation makes the battlefield difficult to traverse. All terrain features are treated as difficult, and any terrain feature that was already difficult now counts as dangerous. ');
INSERT INTO `w7f_map`.`planettrait` (`planettraitid`, `name`, `desc`, `trait_1`, `trait_2`, `trait_3`, `trait_4`, `trait_5`, `trait_6`, `trait_7`, `kt_trait_1`, `kt_trait_2`) VALUES (4, 'Cold ', NULL, 'Snowstorm: Blinding snow and frozen targeters obscure your foe from view. When shooting an enemy unit, subtract 6” from the range of all ranged weapons, to a minimum of 6”.', 'Avalanche: Triggered by the onslaught of heavy guns, an avalanche threatens to sweep away your forces. Roll one d6 at the end of each battle round, adding one to the result for each round that has passed. On a 6+, the avalanche has been triggered. Roll a d6, to determine which direction the models are being pushed by nominating one long edge as “1” and the other edges clockwise from there, with 5 being the center of the board, and rerolling 6s. Move each non-AIRCRAFT unit not on the second floor of a building 12” towards the rolled side or the center of the table, stopping the movement if they hit terrain or the edge of the board first. Once the Avalanche has occurred, do not roll for it any more. ', NULL, NULL, NULL, NULL, NULL, 'Bitter Cold: Cold winds slow even the most obstinate warriors. When a model rolls to advance, treat any roll that’s higher than 4 as 4. ', NULL);
INSERT INTO `w7f_map`.`planettrait` (`planettraitid`, `name`, `desc`, `trait_1`, `trait_2`, `trait_3`, `trait_4`, `trait_5`, `trait_6`, `trait_7`, `kt_trait_1`, `kt_trait_2`) VALUES (5, 'Ice', NULL, 'Frozen Reflexes: Subzero temperatures dull the senses and sap strength from warriors. The Overwatch and Cognis Overwatch stratagems cost 1 additional CP to use.  Additionally when a unit has charged or has a rule stating they would automatically fight first, ignore that rule. Instead, starting with the player whose turn it is, players alternate selecting units to fight with. If a unit would be forced to fight last, that unit still fights last. ', 'Emergency Cooling: Exposing overheating weapon cores or dumping burning coolant onto the frozen ground can keep a warrior alive for a few moments more. When a model would be removed or suffer mortal wounds as a result of rolling a 1 on an attack roll (Such as Supercharging a Plasma Cannon or Overcharging an Ion Rifle) do not remove the model or suffer the mortal wounds at the end of the attack as normal. Instead roll a D6 for each model that would be removed or mortal wound that would be suffered. On a 5+ the model is not removed or suffers the moral wound.', NULL, NULL, NULL, NULL, NULL, 'Whiteout: A roaring snowstorm tears through the battlefield. All ranged attacks treat the target as obscured. ', NULL);
INSERT INTO `w7f_map`.`planettrait` (`planettraitid`, `name`, `desc`, `trait_1`, `trait_2`, `trait_3`, `trait_4`, `trait_5`, `trait_6`, `trait_7`, `kt_trait_1`, `kt_trait_2`) VALUES (6, 'Warp ', NULL, 'Flowing Tides: The power of the warp waxes and wanes here, making psychic powers even more erratic. At the start of each Battle Round, roll a D6. On a 1 or 2, the battlefield is treated as being affected by the Calm Tides System Trait. On a 3 or 4 there is no effect. On a 5 or 6, the battlefield is treated as being affected by the Raging Tides System Trait. ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
