INSERT INTO `w7f_map`.`atmosphere` (`atmosphereid`, `name`, `desc`) VALUES (0, 'Void', 'Add 6” to non-auto hitting weapons. (Optional) Hard-Void: Reroll successful armor saves for INFANTRY, BEASTS, BIKERS, and CAVALRY as while the armor plate may have stopped the bolter round there might be a tear in your void suit now. This trait gives an additional +1 BP, to the cap of +2, if it is used. ');
INSERT INTO `w7f_map`.`atmosphere` (`atmosphereid`, `name`, `desc`) VALUES (1, 'Thin Deadly', 'Acid floats in their air here potent enough to break the strongest seals, All Units  		  suffer a Mortal Wound at the start of the battle round.');
INSERT INTO `w7f_map`.`atmosphere` (`atmosphereid`, `name`, `desc`) VALUES (2, 'Thin Corrosive', 'Dissolved walls make for poor cover. Light cover provided by terrain gives no benefit');
INSERT INTO `w7f_map`.`atmosphere` (`atmosphereid`, `name`, `desc`) VALUES (3, 'Thin Toxic', 'Plagues, septic filth, and hazardous materials fog the air here. Unmodified ');
INSERT INTO `w7f_map`.`atmosphere` (`atmosphereid`, `name`, `desc`) VALUES (4, 'Thin Tainted/Pure', 'No effect');
INSERT INTO `w7f_map`.`atmosphere` (`atmosphereid`, `name`, `desc`) VALUES (5, 'Moderate Deadly', 'The air is damp with acidic fog that would strip unprotected flesh to bone in ');
INSERT INTO `w7f_map`.`atmosphere` (`atmosphereid`, `name`, `desc`) VALUES (6, 'Moderate Corrosive', 'Heavy corrosion eats into untreated structures. Light cover and dense cover   provided by terrain gives no benefit.');
INSERT INTO `w7f_map`.`atmosphere` (`atmosphereid`, `name`, `desc`) VALUES (7, 'Moderate Toxic', 'The air and soil here are rife with microbial life and poisonous elements. ');
INSERT INTO `w7f_map`.`atmosphere` (`atmosphereid`, `name`, `desc`) VALUES (8, 'Modearate Tainted/Pure', 'No effect');
