INSERT INTO `w7f_map`.`faction` (`facid`, `name`, `home_system`, `desc`) VALUES (9, 'Kaptain Squigbeard\'s WAAAAAGGGH', 1, 'The Orks of Kunnin Killin are the piratical survivors of a once great WAAAGH that swept over the system in the 37th millennium. Shot down by their one time allies, the survivors crafted an armada of battleships and subs and purged the scattered human survivors. With the entire world under their control, the orks could have begun conquering the system, but swiftly they fell to squabbling amongst themselves, competing to see who\'s Kill Shipz have the biggest guns or the hardest hulls. In recent years, Captain Squigbeard has united many of the squabbling bands, and his ship the Big Krakn is the largest that has sailed the seas. Under his leadership, the orks of Killa Kunnin now Exceedingly mercenary, rumors of small bands of Orks selling their services for ships and transport as of yet remain unconfirmed. ');
INSERT INTO `w7f_map`.`faction` (`facid`, `name`, `home_system`, `desc`) VALUES (10, 'Crowndaggahs Flashy Gitz', 2, 'Based on the frigid world of Xurit, Crowndaggahs mob, known as the Flashy Gitz has infested most of the system. Ork spacecraft prowl the void, escorting convoys of materials back to Xurit, to be forged into even more warmachines. Ork titan forges work day and night, and super heavy walkers shake the earth with their tread. All of this is search for one goal. The best bitz and gubbins for Crowndaggahâ€™s Regalia. Crowndaggahâ€™s forces have raided the Arbo Collective for years, but with reports of new forces entering the system, the Gitzâ€™s activities have reached a frenzied pitch, and a WAAAAGGGHHH is now brewing ');
INSERT INTO `w7f_map`.`faction` (`facid`, `name`, `home_system`, `desc`) VALUES (11, 'Rak\'gol - Xenos Horrificus', 3, 'The Rak\'gol are a horrific race, encountered only on the fringes of the Imperium. Twisted and warped creatures, Rak\'gol exist only to slaughter, pillage and destroy. No known communication for a Rak\'gol ship has ever been recorded, and attempts to negotiate have only ended in the death of those foolish enough to try. What ambition they may have here is unknown. ');
INSERT INTO `w7f_map`.`faction` (`facid`, `name`, `home_system`, `desc`) VALUES (12, 'Kindred Adett', 4, 'A small band of Kroot, Kindred Adett has come on the order of their Shaper, Chartai. Hunting the dangerous beasts of Kazon 10, the Kindred has no strong ties to any major faction, having taken mercenary work for all manner of clientele across the galaxy.');
INSERT INTO `w7f_map`.`faction` (`facid`, `name`, `home_system`, `desc`) VALUES (13, 'The Abro Collective', 6, 'Once mankind shaped the stars. With the STC system, entire systems were reformed and settled by the children of Terra. When the shroud of Long Night fell, the Abro Collective endured, thanks to the abundance of resources and a system of training psykers. Plans to explore this region of space during the Great Crusade were terminated as the Horus Heresy began, and the Abro remained undiscovered. The Abro continued to maintain their civilization and culture as best they could, though attacks from the Orks, the Rak\'Gol, and other, stranger beings curtailed further expansion. In the late 41st millennium, the Imperium finally encountered the Abro. The Abro were initially overjoyed to meet other humans, free of the taint of Chaos, but as the Imperium\'s initial demands grew, negotiations cooled, and then soured. A general muster went out amongst the Abro, and the Collective readied themselves for war. ');
INSERT INTO `w7f_map`.`faction` (`facid`, `name`, `home_system`, `desc`) VALUES (14, 'The Nanite Swarm', 8, 'The Nanite Swarm came to Corrcon after leaving the Absconrio System behind. Uninhabited by any other life forms, the Swarm has grown since their initial contact and now dominates the system. Each world in the Corrcon system hosts at least a minor military installation, and patrol fleets regularly sweep the system\'s Mandeville Points. The Nanites have not opened any formal communication channels so far, and seem content to be left alone in the system.');
INSERT INTO `w7f_map`.`faction` (`facid`, `name`, `home_system`, `desc`) VALUES (15, 'Free Troggoths', 11, 'The Troggoths of Absconrio have long been oppressed by the Imperium of man. Enslaved, beaten and driven back from their homes, the Troggoths could not stand against the imperium alone. With the arrival of the Orks, the Troggoths found kindred spirits in the Gretchin, and together both races have stood against their masters. Towards the end of the Absconrio Wars, the Tau gifted the Troggoths with a hidden city, and though few could understand why it had been done, and even fewer could communicate with the Tau, the Troggoths and their allies retreated underground, rebuilding their shattered civilization');
INSERT INTO `w7f_map`.`faction` (`facid`, `name`, `home_system`, `desc`) VALUES (0, 'None', 0, NULL);
INSERT INTO `w7f_map`.`resources` (`resource_id`, `name`, `desc`) VALUES (0, 'None', 'As empty as Kitten\'s love life');
